import logo_1 from './images/logo_1.jpg';
import 'bootstrap/dist/css/bootstrap.min.css';
import Button from '@mui/material/Button';
import { createTheme, alpha, getContrastRatio } from '@mui/material/styles';

const Nav = () => {

    const pinkBase = "#fca5a5";
    const pinkMain = alpha(pinkBase, 0.7);

    const theme = createTheme({
        palette: {
            pink : {
                main : pinkMain,
                light: alpha(pinkBase, 0.5),
                dark: alpha(pinkBase, 0.9), 
                contrastText : getContrastRatio(pinkMain, '#fff') > 4.5 ? '#fff' : '#111',
            },
        },
    })

    return(
        <nav className="navbar navbar-expand-sm navbar-light bg-light p-0">
            <div className="container">
                
                <a href='/' className='navbar-brand mb-0 h1 d-flex align-items'>
                    <img src={logo_1} alt="Logo" width="40"/>
                    <p>NextBook</p>
                </a>
            
                <button className="navbar-toggler " type="button" data-bs-toggle="collapse" data-bs-target="#navbarNav" aria-controls="navbarNav" aria-expanded="false" aria-label="Toggle navigation">
                    <span className="navbar-toggler-icon"></span>
                </button>

                <div className="collapse navbar-collapse" id="navbarNav">                
                    
                    <div className="container d-flex justify-content-center">

                        <ul className="navbar-nav">
                            
                            <li className="nav-item">
                                <a href="/" className="nav-link">
                                    Home
                                </a>
                            </li>
                        
                            <li className="nav-item">
                                <a href="/" className="nav-link">
                                    About
                                </a>
                            </li>

                            <li className="nav-item">
                                <a href="/" className="nav-link">
                                    Contact
                                </a>
                            </li>
                        
                        </ul>

                    </div>

                        <form action="/" className="d-flex">
                            <Button size='secondary' variant='contained' color="pink" href='/'>SignIn</Button>
                        </form>
                </div>

            </div>

        </nav>
    );
}

export default Nav;
